contracts/Owner.sol.content:
pragma solidity 0.8.7;

contract Owner { 

    address owner; 
    uint nombre;

    constructor() { 
        owner = msg.sender;
    }

    function setNombre(uint _nombre) public { 
        require(msg.sender == owner, 'Not the owner');
        nombre = _nombre;
    }

    function getNombre() public view returns(uint) { 
        return nombre;
    }
}

